/*Table structure for table `message_limits` */

DROP TABLE IF EXISTS `message_limits`;

CREATE TABLE `message_limits` (
  `id` int(11) NOT NULL,
  `limits` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `message_limits` */

